DROP TABLE IF EXISTS access_rights;

CREATE TABLE `access_rights` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `admin_id` int(11) NOT NULL COMMENT 'Employee Id',
  `Dashboardv1` float NOT NULL DEFAULT '0',
  `DashboardHrm` float NOT NULL DEFAULT '0',
  `DashboardSales` float NOT NULL DEFAULT '0',
  `Reports` float NOT NULL DEFAULT '0',
  `Profile` float NOT NULL DEFAULT '0',
  `ListRegions` float NOT NULL DEFAULT '0',
  `ListAreas` float NOT NULL DEFAULT '0',
  `ListTerritories` float NOT NULL DEFAULT '0',
  `ViewCatalogueAssignments` float NOT NULL DEFAULT '0',
  `DailyRouting` float NOT NULL DEFAULT '0',
  `ListCampaigns` float NOT NULL DEFAULT '0',
  `AddEmployee` float NOT NULL DEFAULT '0',
  `ListEmployees` float NOT NULL DEFAULT '0',
  `Attendance` float NOT NULL DEFAULT '0',
  `EmployeesList` float NOT NULL DEFAULT '0',
  `AddInventory` float NOT NULL DEFAULT '0',
  `ListInventory` float NOT NULL DEFAULT '0',
  `ProductGallery` float NOT NULL DEFAULT '0',
  `ListMainCategories` float NOT NULL DEFAULT '0',
  `ListSubCategories` float NOT NULL DEFAULT '0',
  `ListSubInventory` float NOT NULL DEFAULT '0',
  `ListUnits` float NOT NULL DEFAULT '0',
  `ViewCatalogues` float NOT NULL DEFAULT '0',
  `ListRetailers` float NOT NULL DEFAULT '0',
  `ListRetailerTypes` float NOT NULL DEFAULT '0',
  `ListRetailersAssignments` float NOT NULL DEFAULT '0',
  `ListOrders` float NOT NULL DEFAULT '0',
  `ListGroups` float NOT NULL DEFAULT '0',
  `ListMessages` float NOT NULL DEFAULT '0',
  `UpdateInventorySku` float NOT NULL DEFAULT '0',
  `ListRights` float NOT NULL DEFAULT '0',
  `NewAccRights` float NOT NULL DEFAULT '0',
  `Pending` float NOT NULL DEFAULT '0',
  `Processed` float NOT NULL DEFAULT '0',
  `Completed` float NOT NULL DEFAULT '0',
  `Cancelled` float NOT NULL DEFAULT '0',
  `Latest` float NOT NULL DEFAULT '0',
  `ListQuestionnaires` float NOT NULL DEFAULT '0',
  `CreateQuestionnaire` float NOT NULL DEFAULT '0',
  `UpdateQuestionnaire` float NOT NULL DEFAULT '0',
  `ManualOrders` float NOT NULL DEFAULT '0',
  `EmpKpi` float NOT NULL DEFAULT '0',
  `EmpKpiSettings` float NOT NULL DEFAULT '0',
  `UpdateKpiSettings` float NOT NULL DEFAULT '0',
  `Hierarchy` float NOT NULL DEFAULT '0',
  `DistributorProfile` float NOT NULL DEFAULT '0',
  `RetailerProfile` float NOT NULL DEFAULT '0',
  `EmployeeProfile` smallint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS admin_credentials;

CREATE TABLE `admin_credentials` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `admin_un` varchar(100) NOT NULL,
  `admin_pw` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS admin_session;

CREATE TABLE `admin_session` (
  `session` varchar(50) NOT NULL,
  `admin_id` int(11) NOT NULL,
  PRIMARY KEY (`session`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ams;

CREATE TABLE `ams` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `latitude` double NOT NULL,
  `longitude` double NOT NULL,
  `checking_status` float NOT NULL COMMENT '1: check_in, 0: check_out',
  `employee_id` int(11) NOT NULL,
  `within_radius` float NOT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=270 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS area_management;

CREATE TABLE `area_management` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `area_name` varchar(100) NOT NULL,
  `area_poc_id` int(11) NOT NULL,
  `region_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS bulletin_groups;

CREATE TABLE `bulletin_groups` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `group_name` varchar(100) NOT NULL,
  `employee_id` text NOT NULL COMMENT 'Comma Seperated',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS bulletin_messages;

CREATE TABLE `bulletin_messages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `message` text NOT NULL,
  `group_id` int(11) DEFAULT NULL,
  `individual_id` int(11) DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS campaign_management;

CREATE TABLE `campaign_management` (
  `campaign_id` int(11) NOT NULL AUTO_INCREMENT,
  `campaign_name` varchar(100) NOT NULL,
  `eligibility_criteria_pref_id` int(11) NOT NULL COMMENT 'item which will activate the scheme',
  `minimum_quantity_for_eligibility` int(11) NOT NULL COMMENT 'Minimum quantity of the item to activate the scheme',
  `item_given_free_pref_id` int(11) DEFAULT NULL COMMENT 'Box given free',
  `quantity_for_free_item` int(11) DEFAULT NULL COMMENT '# of boxes given free',
  `scheme_amount` int(11) DEFAULT NULL,
  `distributor_discount` int(11) DEFAULT NULL COMMENT 'Discount on scheme if scheme_type = 1 otherwise discount on TP',
  `price_discount_of_this_pref_id` int(11) DEFAULT NULL COMMENT 'If scheme type is discount_on_tp',
  `discount_on_tp_pkr` int(11) DEFAULT NULL,
  `scheme_image` mediumtext NOT NULL,
  `scheme_active` float NOT NULL DEFAULT '1',
  `scheme_type` float NOT NULL COMMENT 'scheme type 1: (24+1) & scheme type 2: (discount on TP)',
  `territory_id` int(11) DEFAULT NULL,
  `area_id` int(11) DEFAULT NULL,
  `region_id` int(11) DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`campaign_id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS catalogue_assignment;

CREATE TABLE `catalogue_assignment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `catalogue_id` int(11) NOT NULL,
  `employee_id` int(11) NOT NULL,
  `active_from` date DEFAULT NULL,
  `active_till` date DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=73 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS catalogues;

CREATE TABLE `catalogues` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `catalogue_name` varchar(100) NOT NULL,
  `pref_id` text NOT NULL COMMENT 'Comma Seperated',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ci_session;

CREATE TABLE `ci_session` (
  `id` varchar(40) NOT NULL,
  `ip_address` varchar(45) NOT NULL,
  `timestamp` int(10) unsigned NOT NULL DEFAULT '0',
  `data` blob NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ci_sessions_timestamp` (`timestamp`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS dashboard_retailer_temp;

CREATE TABLE `dashboard_retailer_temp` (
  `tbl_id` int(11) NOT NULL AUTO_INCREMENT,
  `booking_territory` varchar(50) DEFAULT NULL,
  `retail_outlet_territory` varchar(50) DEFAULT NULL,
  `total_retailers_added` varchar(50) DEFAULT NULL,
  `ordering_retailers` varchar(50) DEFAULT NULL,
  `top_10_territory` varchar(50) DEFAULT NULL,
  `revenue` varchar(50) DEFAULT NULL,
  `1000` varchar(50) DEFAULT NULL,
  `0_300` varchar(50) DEFAULT NULL,
  `301_500` varchar(50) DEFAULT NULL,
  `501_1000` varchar(50) DEFAULT NULL,
  `report_type` enum('retail_outlets_data','top_10_territories_data','arpu') DEFAULT NULL,
  `total_retail_outlets` int(50) DEFAULT NULL,
  `productive_retail_outlets` varchar(50) DEFAULT NULL,
  `avg_revenue` varchar(50) DEFAULT NULL,
  `re_orders` varchar(50) DEFAULT NULL,
  `productive_visits` varchar(50) DEFAULT NULL,
  `total_visits` varchar(50) DEFAULT NULL,
  `productive_ratio` varchar(50) DEFAULT NULL,
  `avg_expansion_ratio` varchar(50) DEFAULT NULL,
  `avg_sale_per_employee` varchar(50) DEFAULT NULL,
  `avg_productive_retailers_per_employee` varchar(50) DEFAULT NULL,
  `churned_retailers` varchar(50) DEFAULT NULL,
  `avg_orders_per_retailer` varchar(50) DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`tbl_id`)
) ENGINE=InnoDB AUTO_INCREMENT=249 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS database_backup;

CREATE TABLE `database_backup` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `backup_file_name` varchar(500) NOT NULL,
  `backup_status` varchar(50) NOT NULL DEFAULT 'failed',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS employee_daily_routing;

CREATE TABLE `employee_daily_routing` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_id` int(11) NOT NULL,
  `route_lats` double NOT NULL,
  `route_longs` double NOT NULL,
  `routing_day` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS employee_session;

CREATE TABLE `employee_session` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(100) NOT NULL,
  `session` varchar(50) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_session` (`session`)
) ENGINE=InnoDB AUTO_INCREMENT=1545 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS employee_visit_plan;

CREATE TABLE `employee_visit_plan` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `retailer_id` int(11) NOT NULL,
  `employee_id` int(11) NOT NULL,
  `plan_for_day` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2374 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS employees_info;

CREATE TABLE `employees_info` (
  `employee_id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_first_name` varchar(50) NOT NULL,
  `employee_last_name` varchar(50) NOT NULL,
  `employee_username` varchar(50) NOT NULL,
  `employee_password` varchar(50) NOT NULL,
  `employee_email` varchar(100) DEFAULT NULL,
  `employee_address` varchar(100) NOT NULL,
  `employee_city` varchar(60) NOT NULL,
  `employee_country` varchar(60) DEFAULT 'Pakistan',
  `employee_picture` varchar(500) NOT NULL,
  `reporting_to` int(11) DEFAULT NULL,
  `territory_id` int(11) NOT NULL,
  `employee_cnic` varchar(20) NOT NULL,
  `employee_hire_at` date NOT NULL,
  `employee_fire_at` date DEFAULT NULL,
  `employee_designation` varchar(100) NOT NULL,
  `employee_phone` varchar(20) NOT NULL,
  `employee_salary` int(11) NOT NULL,
  `employee_base_station_lats` double DEFAULT NULL,
  `employee_base_station_longs` double DEFAULT NULL,
  `is_admin` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`employee_id`)
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS inventory_items;

CREATE TABLE `inventory_items` (
  `item_id` int(11) NOT NULL AUTO_INCREMENT,
  `item_name` varchar(500) NOT NULL,
  `item_sku` varchar(20) NOT NULL,
  `item_main_description` text,
  PRIMARY KEY (`item_id`),
  KEY `item_id_index` (`item_id`),
  KEY `item_name_index` (`item_name`),
  KEY `id_name_index` (`item_id`,`item_name`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS inventory_preferences;

CREATE TABLE `inventory_preferences` (
  `pref_id` int(11) NOT NULL AUTO_INCREMENT,
  `item_id` int(11) NOT NULL,
  `unit_id` int(11) NOT NULL,
  `item_barcode` varchar(20) DEFAULT NULL,
  `item_quantity` int(11) NOT NULL,
  `item_warehouse_price` int(11) NOT NULL,
  `item_trade_price` int(11) NOT NULL,
  `item_retail_price` int(11) NOT NULL,
  `sub_category_id` int(11) DEFAULT NULL,
  `item_thumbnail` text,
  `item_image` text,
  `item_description` text,
  PRIMARY KEY (`pref_id`),
  KEY `item_id_index` (`item_id`),
  KEY `pref_index` (`pref_id`),
  KEY `pref_item_index` (`pref_id`,`item_id`)
) ENGINE=InnoDB AUTO_INCREMENT=273 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS inventory_types_units;

CREATE TABLE `inventory_types_units` (
  `unit_id` int(11) NOT NULL AUTO_INCREMENT,
  `unit_name` varchar(100) NOT NULL,
  `unit_short_name` varchar(50) NOT NULL,
  `unit_plural_name` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`unit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS kpi_management;

CREATE TABLE `kpi_management` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `kpi_type` enum('product','quantity','revenue') NOT NULL,
  `pref_id` int(11) DEFAULT NULL COMMENT 'In case of product wise',
  `unit_id` int(11) DEFAULT NULL COMMENT 'In case of quantity wise',
  `target` int(11) NOT NULL,
  `eligibility` int(11) NOT NULL,
  `weightage` int(11) NOT NULL,
  `incentive` int(11) NOT NULL,
  `criteria` enum('monthly','quarterly') NOT NULL,
  `criteria_parameter` varchar(50) NOT NULL COMMENT 'month or quarter',
  `evaluation_from_employees` tinyint(1) NOT NULL DEFAULT '0',
  `created_by` int(11) NOT NULL,
  `created_for` varchar(500) NOT NULL COMMENT 'Employee',
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS login_attempt;

CREATE TABLE `login_attempt` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(100) NOT NULL,
  `password` varchar(100) NOT NULL,
  `status` varchar(50) DEFAULT 'failed',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=37 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS main_categories;

CREATE TABLE `main_categories` (
  `main_category_id` int(11) NOT NULL AUTO_INCREMENT,
  `main_category_name` varchar(100) NOT NULL,
  `is_active` float NOT NULL DEFAULT '1',
  PRIMARY KEY (`main_category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS order_contents;

CREATE TABLE `order_contents` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pref_id` int(11) NOT NULL,
  `item_quantity_booker` int(11) NOT NULL,
  `item_quantity_updated` int(11) DEFAULT NULL,
  `booker_discount` float NOT NULL DEFAULT '0' COMMENT 'percentage',
  `final_price` double NOT NULL,
  `campaign_id` int(11) DEFAULT NULL,
  `item_status` int(1) NOT NULL DEFAULT '1' COMMENT '0:delete, 1:active, 2:order expanded',
  `order_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `pref_id_index` (`pref_id`),
  KEY `pref_order_index` (`pref_id`,`order_id`),
  KEY `order_index` (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4376 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS orders;

CREATE TABLE `orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_id` int(11) NOT NULL,
  `catalogue_id` int(11) NOT NULL,
  `retailer_id` int(11) NOT NULL,
  `booker_lats` double NOT NULL,
  `booker_longs` double NOT NULL,
  `within_radius` float DEFAULT NULL,
  `status` varchar(50) DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT NULL,
  `booking_region` varchar(100) DEFAULT NULL,
  `booking_area` varchar(100) DEFAULT NULL,
  `booking_territory` varchar(100) DEFAULT NULL,
  `invoice_number` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2217 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS questionnaire_results;

CREATE TABLE `questionnaire_results` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `answer` text NOT NULL,
  `comments` text,
  `employee_id` int(11) NOT NULL,
  `questionnaire_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS questionnaires;

CREATE TABLE `questionnaires` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `question` text NOT NULL,
  `multiple_choices` text NOT NULL,
  `individual_id` int(11) DEFAULT NULL,
  `group_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS regions_info;

CREATE TABLE `regions_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `region_name` varchar(100) NOT NULL,
  `region_poc_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS retailer_types;

CREATE TABLE `retailer_types` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `retailer_type_name` varchar(100) NOT NULL,
  `discount` float NOT NULL DEFAULT '0',
  `retailer_or_distributor` enum('ret','dist') NOT NULL DEFAULT 'dist',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS retailers_assignment;

CREATE TABLE `retailers_assignment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `retailer_id` int(11) NOT NULL,
  `employee_id` int(11) NOT NULL,
  `assigned_for_day` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3496 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS retailers_details;

CREATE TABLE `retailers_details` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `retailer_name` varchar(100) NOT NULL,
  `retailer_phone` varchar(20) DEFAULT NULL,
  `retailer_email` varchar(100) DEFAULT NULL,
  `retailer_address` varchar(500) NOT NULL,
  `retailer_lats` double NOT NULL,
  `retailer_longs` double NOT NULL,
  `retailer_city` varchar(100) DEFAULT NULL,
  `retailer_type_id` int(11) DEFAULT NULL,
  `retailer_territory_id` int(11) DEFAULT NULL,
  `retailer_image` text,
  `added_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2517 DEFAULT CHARSET=latin1;

